import React from 'react';
import Table from 'react-bootstrap/Table';

const Cafe = (props) => {
    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <th scope="row">{props.title.id}</th>
                    <td>{props.title.nombre}</td>
                    <td>{props.title.tipo}</td>
                    <td>{props.title.region}</td>
                </tr>
            </tbody>
        </Table>
    );

}

export default Cafe;
